import 'bootstrap/dist/css/bootstrap.min.css';
import '../css/main.css';

class Main extends Component {
  render() {
    return (
      <React.Fragment>
        <div className='row mb-3'>
          <div className='col-12 col-lg-2'>
            <ToolBar />
          </div>
          <div className='col-12 col-lg-10'>
            <Pic34 />
          </div>
        </div>
      </React.Fragment>
    )
  }
}

export default Main;
